commits.content:
header { 
  height: 10vh;
  display: flex;
  justify-content: space-between;
  align-items: center;
  grid-area: header;
}
.logo_img img{
  border-radius: 50%;
    width: 50%;
    padding: 0px;
    position: relative;
    top: 3vh;
    left: 50px;
    box-shadow: 0px 0.5px 5px black;  
}
li, a, a:visited {
  padding: 5px;
  text-decoration: none;
  list-style: none;
}
a:hover {
  color: red;
}

/**** NAVBAR ****/
nav {
  display: flex;
  padding: 20px;
}
nav ul {
  display: flex;
  justify-content: space-between;
}
#icons {
  cursor: pointer;
  display: none;
}
